const Index = (todoItems) => {
    todoItems.map((item) => {
        return (
          <tr>
            <td>{item.id}</td>
            <td>{item.name}</td>
            <td>{item.description}</td>
            <td>
              <button>Update</button>
            </td>
          </tr>
        )
    })
}

export default Index;
